import React from 'react';
import RestaurantCard from './RestaurantCard';

function ResultsGrid({ results, onResultClick }) {
  return (
    <div className="resultsGrid">
      {results.length > 0 ? (
        results.map((result) => (
          <RestaurantCard key={result._id} result={result} onClick={onResultClick} />
        ))
      ) : (
        <p>No results found</p>
      )}
    </div>
  );
}

export default ResultsGrid;
